Look & Cook поможет разнообразить ваш рацион сбалансированными и здоровыми блюдами и сохранит ваше время. Планируйте неделю и не тратьте часы на кухне.

Look & Cook больше, чем сборник авторских рецептов от фудблогера @look_whaticook. Это ваш помощник в планировании ежедневного питания с пошаговым приготовлением сбалансированных по БЖУ блюд. 
Я верю, что правильное питание – это не курица с гречкой, это вкусные и красивые блюда из доступных продуктов, который может приготовить каждый. Обещаю, большинство рецептов не отнимет у вас и 30 минут. 

При регистрации приложение попросит поделиться вашими данными: фактическим весом, ростом, датой рождения, полом и уровнем физической активности. После чего – вы получите расчет суточной нормы калорий, БЖУ и доступ к полному функционалу приложения бесплатно на 14 дней. 
Чтобы получить доступ к приложению на постоянной основе, достаточно оформить ежемесячную подписку. 

В приложении вы найдете: 
- Рецепты, сбалансированные по БЖУ;
- Калораж, рассчитанный на одну порцию; 
- Удобный поиск по тематике или приему пищи; 
- Регулярно пополняющуюся базу рецептов; 
- Удобный календарь для планирования недели; 
- Рецепты для аллергиков: без глютена, лактозы;
- Веганские рецепты. 

Разрешите приложению отправлять вам уведомления – так вы не пропустите публикации новых оригинальных рецептов. 

Обязательно делитесь своим мнением о приложении – ваши отзывы помогут сделать его еще лучше.

Правила использования и политика обработки персональных данных: https://lwic-800ea.web.app/agreement.html

